import React from 'react';
import '../.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <p className="footer-text">Your footer content goes here.</p>
        <div className="red-element"></div>
      </div>
    </footer>
  );
};

export default Footer;
